import React from "react";
import axios from "axios";
import Layout from "../../../components/Layout";
import { CardGroup, Card } from "semantic-ui-react";
// // import Patient from "../../Ethereum/patient";
// import truncateMiddle from "truncate-middle";
// // import header from "../../components/header";
// import { Card, Table, Grid, Button, Popup } from "semantic-ui-react";
// // import web3 from "../../Ethereum/web3";
// import { Link } from "../../../routes";
// import { response } from "express";


class dataRead extends React.Component {

    static async getInitialProps(props) {
        const { referenceKey } = props.query;
        const refData = axios.get(`http://localhost:5000/references/get/${referenceKey}`)
            .then(response => console.log(response));
        const item = refData.response;
        return { referenceKey, item }

    }

    renderData() {
        const {
            referenceKey,
            item
        } = this.props
        console.log(item);
        return (
            <Card.Content
                header={referenceKey}
                meta='Friend'
                description='Elliot is a music producer living in Chicago.'
            />
        )

    }


    render() {
        return (
            <Layout>
                <CardGroup>
                    <Card>
                        {this.renderData()}
                    </Card>
                </CardGroup>
            </Layout>
        );
    }
}
export default dataRead;
